import React from 'react';

const Frame71a = () => {
  return (
    <div
      style={{
        width: '366px',
        minHeight: '493px',
        display: 'flex',
        flexDirection: 'column',
      }}
    >
      <div
        style={{
          width: '366px',
          height: '76px',
          fontFamily: 'Sora, sans-serif',
          fontWeight: 600,
          fontSize: '28px',
          lineHeight: '38px',
          letterSpacing: '-0.05em',
          textTransform: 'capitalize',
          color: '#1C264C',
          marginBottom: '16px',
        }}
      >
        A new way to move goods Tap. Track. Done.
      </div>
      {/* Dashed line */}
      <hr
        style={{
          width: '366px',
          border: 'none',
          borderTop: '1px dashed #16110D',
          marginBottom: '8px', // less gap as in Figma
          height: '0',
        }}
      />
      {/* Bullet list */}
      <ul
        style={{
          width: '366px',
          fontFamily: 'Sora, sans-serif',
          fontWeight: 400,
          fontSize: '16px',
          lineHeight: '28px',
          letterSpacing: '-0.05em',
          color: '#16110D',
          margin: 0,
          marginBottom: '16px',
          paddingLeft: '20px',
        }}
      >
        <li>Book mini truck in seconds</li>
        <li>Choose your pickup & drop location and</li>
        <li>Select the desired vehicle.</li>
        <li>Select the respected highly ranked</li>
        <li>Transporters from our list</li>
        <li>Weâ€™ll take care of the rest.</li>
      </ul>
      {/* Second dashed line */}
      <hr
        style={{
          width: '366px',
          border: 'none',
          borderTop: '1px dashed #16110D',
          marginBottom: '8px', // less gap as in Figma
          height: '0',
        }}
      />
      {/* Frame72: Input box */}
      <div
        style={{
          display: 'flex',
          flexDirection: 'row',
          alignItems: 'center',
          width: '510px', // match Figma width
          height: '44px', // match Figma height
          borderRadius: '22px', // more rounded as in Figma
          border: '1px dashed #EE4237',
          background: 'transparent', // remove background
          paddingLeft: '18px',
          paddingRight: '18px',
          marginBottom: '16px',
        }}
      >
        <input
          type="text"
          placeholder="Enter mobile number to get app link via SMS."
          style={{
            width: '100%',
            height: '100%',
            border: 'none',
            outline: 'none',
            background: 'transparent',
            fontFamily: 'Sora, sans-serif',
            fontSize: '22px',
            color: '#16110D', // black text
            fontWeight: 400,
            letterSpacing: '-0.01em',
          }}
        />
      </div>
      {/* Additional Frame71a content goes here */}
    </div>
  );
};

export default Frame71a;
